export default {
  name: 'University',
  data() {
    return {
      unidata: null
    };
  },
  mounted() {
    axios({
      method: 'get',
      url: 'http://localhost:8080/university/{uniName}',
      params: {
        uniName: 'national-university-of-singapore'
      }
    }).then(response => {
      if (response != null) {
        this.unidata = response;
      }
    }).catch(error => {
      alert(error.message);
    });
  },
  computed: {
    axiosParams() {
      const params = new URLSearchParams();
      params.append('uniName', 'national-university-of-singapore');
      return params;
    }
  }
};
